INSERT INTO button2 (id, title, content, publishTime, scheduledPublishTime, externalSource, visibility, isPublished, featured, createdBy, created_at, updated_at, category) VALUES ('1', 'Submit Document ', '<p>BPIKD publishes documents of political or historical importance that are censored or otherwise suppressed. We specialise in strategic global publishing and large archives.</p><p>The following is the address of our secure site where you can anonymously upload your documents to WikiLeaks editors. You can only access this submissions system through Tor. (See our Tor tab for more information.) We also advise you to read our tips for sources before submitting.</p>', 'Now', 'Fri Jun 21 2024 23:05:29 GMT+0200 (Central European Summer Time)', 'undefined', 'Public', '1', 'undefined', 'admin', 'Sun Apr 21 2024 12:26:43 GMT+0200 (Central European Summer Time)', 'Fri Jun 21 2024 21:05:43 GMT+0200 (Central European Summer Time)', 'Button2');
