INSERT INTO news (id, category, title, content, publishTime, scheduledPublishTime, externalSource, visibility, isPublished, featured, createdBy, created_at, updated_at) VALUES ('35', 'News', 'Example story ', '<h2>The anatomy of a news story</h2><p>The following article (which can be&nbsp;<a href="https://www.imperial.ac.uk/news/189612/quicker-safer-test-could-accurately-detect/" rel="noopener noreferrer" target="_blank" style="color: rgb(0, 110, 175);">read in full on the News site</a>) is, in many ways, a ‘typical’ Imperial research story. Take a look through the News site and you will see many structured just like it.</p>', 'Now', 'Wed May 29 2024 12:35:31 GMT+0200 (Central European Summer Time)', 'undefined', 'Public', '1', 'undefined', 'admin', 'Wed May 29 2024 14:35:37 GMT+0200 (Central European Summer Time)', 'Wed May 29 2024 14:35:37 GMT+0200 (Central European Summer Time)');
