INSERT INTO news (id, category, title, content, publishTime, scheduledPublishTime, externalSource, visibility, isPublished, featured, createdBy, created_at, updated_at) VALUES ('42', 'News', 'Example story 2', '<p><span style="color: rgb(0, 0, 0);">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</span></p><p><span style="color: rgb(0, 0, 0);">﻿</span></p>', 'Now', 'Wed Jun 26 2024 09:48:36 GMT+0200 (Central European Summer Time)', 'undefined', 'Public', '1', 'https://bpikd.vizitke.ba/api/uploads/featuredImage-1719388126918.jpg', 'admin', 'Mon Jun 24 2024 10:52:27 GMT+0200 (Central European Summer Time)', 'Wed Jun 26 2024 09:48:46 GMT+0200 (Central European Summer Time)');
