INSERT INTO news (id, category, title, content, publishTime, scheduledPublishTime, externalSource, visibility, isPublished, featured, createdBy, created_at, updated_at) VALUES ('50', 'About', 'Esmeralda', '<p>Esmeralda je meksička telenovela produkcijske kuće Televisa koja se 1998. i 1999. prikazivala u Hrvatskoj. Glavne uloge imali su Leticia Calderón i Fernando Colunga. Jedne olujne noći, Dominga porađa dječaka, čija majka nedugo zatim umire. U međuvremenu, na imanju obitelji Peñarreal, Blanca De Velasco de Peñarreal također rađa. Njen suprug, Don Rodolfo Peñarreal, nestrpljivo čeka kraj poroda u nadi da će dobiti sina. Njihov liječnik ne stiže na imanje jer je oluja prejaka. Obitelj stoga poziva Domingu, koja im donosi dijete.</p>', 'Now', 'Sun Jun 30 2024 12:00:40 GMT+0200 (Central European Summer Time)', 'undefined', 'Public', '1', 'undefined', 'admin', 'Sun Jun 30 2024 12:00:42 GMT+0200 (Central European Summer Time)', 'Sun Jun 30 2024 12:00:42 GMT+0200 (Central European Summer Time)');
INSERT INTO news (id, category, title, content, publishTime, scheduledPublishTime, externalSource, visibility, isPublished, featured, createdBy, created_at, updated_at) VALUES ('53', 'Soon', 'Xena', '<p>Xena: Warrior Princess is an American fantasy television series filmed in New Zealand, which aired in first-run syndication from September 4, 1995, to June 18, 2001.[1] Critics have praised the series for its strong female protagonist, and it has acquired a strong cult following, attention in fandom, parody, and academia, and has influenced the direction of other television series.[2]</p>', 'Now', 'Sun Jun 30 2024 12:04:45 GMT+0200 (Central European Summer Time)', 'undefined', 'Public', '1', 'https://bpikd.vizitke.ba/api/uploads/featuredImage-1719741890512.jpg', 'admin', 'Sun Jun 30 2024 12:04:50 GMT+0200 (Central European Summer Time)', 'Sun Jun 30 2024 12:04:50 GMT+0200 (Central European Summer Time)');
