INSERT INTO persons (id, firstName, lastName, aboutPerson, featured, createdBy, created_at, updated_at, category, visibility, fullName, externalSource, scheduledPublishTime, view_count) VALUES ('173', 'Bruce', 'Lee', 'Bruce Lee[b] (born Lee Jun-fan;[c] November 27, 1940 – July 20, 1973) was a Hong Kong-American martial artist and actor. He was the founder of Jeet Kune Do, a hybrid martial arts philosophy drawing from different combat disciplines that is sometimes credited with paving the way for the combat sport mixed martial arts (MMA).[3] Lee is considered by some commentators and martial artists to be the most influential martial artist of all time and a pop culture icon of the 20th century, who bridged the gap between East and West. He is credited with promoting Hong Kong action cinema and helping to change the way Chinese people were presented in American films.[4]', 'https://bpikd.vizitke.ba/api/featured/person-173.jpeg', 'admin', 'Tue Jun 11 2024 11:39:05 GMT+0200 (Central European Summer Time)', 'Sun Jul 28 2024 14:11:49 GMT+0200 (Central European Summer Time)', 'Person of Interest', 'Public', 'Bruce Lee', 'undefined', 'Tue Jun 11 2024 11:39:05 GMT+0200 (Central European Summer Time)', '136');
INSERT INTO persons (id, firstName, lastName, aboutPerson, featured, createdBy, created_at, updated_at, category, visibility, fullName, externalSource, scheduledPublishTime, view_count) VALUES ('174', 'Arnold', 'Schwarzenegger', 'Arnold Alois Schwarzenegger (born July 30, 1947) is an Austrian and American actor, businessman, filmmaker, former politician, and former professional bodybuilder known for his roles in high-profile action movies. He served as the 38th governor of California from 2003 to 2011 and was among Time''s 100 most influential people in the world in 2004 and 2007.[5][6]', 'https://bpikd.vizitke.ba/api/featured/person-arnold.jpeg', 'admin', 'Tue Jun 11 2024 11:42:16 GMT+0200 (Central European Summer Time)', 'Thu Jul 25 2024 10:51:17 GMT+0200 (Central European Summer Time)', 'Person of Interest', 'Public', 'Arnold Schwarzenegger', 'undefined', 'Tue Jun 11 2024 11:42:16 GMT+0200 (Central European Summer Time)', '41');
INSERT INTO persons (id, firstName, lastName, aboutPerson, featured, createdBy, created_at, updated_at, category, visibility, fullName, externalSource, scheduledPublishTime, view_count) VALUES ('175', 'Zdravko', 'Čolić', 'Rođen je 30. svibnja 1951. godine u Sarajevu, a djetinjstvo je proveo na Grbavici. Kao dijete se više zanimao za sport nego za glazbu. Najprije je bio golman u juniorima "Željezničara", da bi ubrzo shvatio kako mu atletika više leži. Na jednom natjecanju osvojio je drugo mjesto, odmah iza tadašnje atletske zvijezde Nenada Stekića.', 'https://bpikd.vizitke.ba/api/featured/person-ZdravkoColic.jpg', 'admin', 'Tue Jun 11 2024 12:53:51 GMT+0200 (Central European Summer Time)', 'Sun Jul 28 2024 14:11:02 GMT+0200 (Central European Summer Time)', 'Person of Interest', 'Public', 'Zdravko Čolić', 'undefined', 'Tue Jun 11 2024 12:53:51 GMT+0200 (Central European Summer Time)', '41');
INSERT INTO persons (id, firstName, lastName, aboutPerson, featured, createdBy, created_at, updated_at, category, visibility, fullName, externalSource, scheduledPublishTime, view_count) VALUES ('176', 'Jim', 'Carrey', 'James Eugene Carrey (/ˈkæri/; born January 17, 1962)[2] is a Canadian-American actor and comedian known for his energetic slapstick performances.[3] After spending the 1980s honing his stand-up comedy act and portraying mostly supporting roles in films, Carrey gained wide recognition in 1990 when he was cast in the American sketch comedy television series In Living Color (1990–1994). ', 'https://bpikd.vizitke.ba/api/featured/person-Screenshot_13.jpg', 'admin', 'Tue Jun 11 2024 12:55:35 GMT+0200 (Central European Summer Time)', 'Sat Jul 27 2024 22:01:24 GMT+0200 (Central European Summer Time)', 'Person of Interest', 'Public', 'Jim Carrey', 'undefined', 'Tue Jun 11 2024 12:55:35 GMT+0200 (Central European Summer Time)', '57');
INSERT INTO persons (id, firstName, lastName, aboutPerson, featured, createdBy, created_at, updated_at, category, visibility, fullName, externalSource, scheduledPublishTime, view_count) VALUES ('177', 'Dr. Nele', 'Karajlić', 'Nenad Janković alias Nele Karajlić (Sarajevo, 11. prosinca 1962.), bosanskohercegovački rock and roll glazbenik, skladatelj, glumac i nekadašnji televizijski direktor u Bosni i Hercegovini. Najpoznatiji kao bivši pjevač Zabranjenog pušenja.', 'https://bpikd.vizitke.ba/api/featured/person-images (1).jpg', 'admin', 'Tue Jun 11 2024 12:58:45 GMT+0200 (Central European Summer Time)', 'Sat Jul 27 2024 22:01:33 GMT+0200 (Central European Summer Time)', 'Person of Interest', 'Public', 'Dr. Nele Karajlić', 'undefined', 'Tue Jun 11 2024 12:58:45 GMT+0200 (Central European Summer Time)', '122');
