INSERT INTO works (id, person_id, title, content, publishTime, isPublished, scheduledPublishTime, externalSource, visibility, category, createdBy, created_at, updated_at, work_view_count) VALUES ('310', '173', '1940–1958: Early roles, schooling and martial arts initiation', '<p>Bruce Lee[b] (born Lee Jun-fan;[c] November 27, 1940 – July 20, 1973) was a Hong Kong-American martial artist and actor. He was the founder of Jeet Kune Do, a hybrid martial arts philosophy drawing from different combat disciplines that is sometimes credited with paving the way for the combat sport mixed martial arts (MMA).[3] Lee is considered by some commentators and martial artists to be the most influential martial artist of all time and a pop culture icon of the 20th century, who bridged the gap between East and West. He is credited with promoting Hong Kong action cinema and helping to change the way Chinese people were presented in American films.[4]</p>', 'Now', '1', 'Thu Jul 18 2024 13:10:31 GMT+0200 (Central European Summer Time)', 'undefined', 'Public', 'undefined', 'admin', 'Thu Jul 18 2024 15:10:36 GMT+0200 (Central European Summer Time)', 'Sun Jul 28 2024 14:11:57 GMT+0200 (Central European Summer Time)', '7');
